import React , {useState} from 'react'
import './Matches.css';


function Matches()  {

    const [san , setSan ]= useState(false) ;
    const [sentiago , setSentiago ]= useState(false) ;
    const [star , setStar ]= useState(false) ;
    const [elshrouk , setElshrouk ]= useState(false) ;

    return(
    <div className="matches">

             <button onClick={ ()=>setSan(!san) & setSentiago(false) & setStar(false) & setElshrouk(false)    }   className="court-name">
              san siro
              </button>

              <button onClick={ ()=>setSentiago(!sentiago) & setSan(false) & setStar(false) & setElshrouk(false)      }  className="court-name" >
              Sentiago
              </button>

              <button onClick= {()=> setStar(!star)  & setSentiago(false) & setStar(false) & setElshrouk(false)     }   className="court-name" >
                Star Park
              </button>
              
              <button onClick={ ()=>setElshrouk(!elshrouk)  & setSentiago(false) & setStar(false) & setElshrouk(false)     }   className="court-name">
              Elsherouk
              </button>



           {
               san?   <div className="star-table">
                 san
               </div> :null
           } 

           {

            sentiago?   <div className="star-table">
                        sentiago
                        </div> :null

            }
             
            {
                star?   <div className="star-table">
                star
            </div> :null

            }

            { 
            elshrouk?   <div className="star-table">
            elshrouk
            </div> :null
            }





           
      
    </div>

    );
}
  export default Matches ;
